pub struct Console {
    threshold: f32,
    drive: f32,
    console_type: crate::duro_process::ConsoleMode,
    sample_rate: f32,
    prev_gain: f32,
    prev_gain2: f32,
}

#[allow(unused_variables)]
impl Console {
    pub fn new(
        threshold: f32,
        ratio: i32,
        console_type: crate::duro_process::ConsoleMode,
        sample_rate: f32,
    ) -> Self {
        Self {
            threshold,
            drive: 0.0,
            console_type: crate::duro_process::ConsoleMode::BYPASS,
            sample_rate,
            prev_gain: 0.0,
            prev_gain2: 0.0,
        }
    }

    pub fn update_vals(&mut self, threshold: f32, drive: f32, console_type: crate::duro_process::ConsoleMode, sample_rate: f32) {
        self.threshold = threshold;
        self.drive = drive;
        self.sample_rate = sample_rate;
        self.console_type = console_type;
    }

    pub fn duro_process(&mut self, sample: f32, sat_type: crate::duro_process::SaturationModeEnum, console_type: crate::duro_process::ConsoleMode) -> f32 
    {
        // Initialize our return value
        let mut consoled_sample = 0.0;
        
        // Initialize Feedback Delay Network Processors
        


        if console_type == crate::duro_process::ConsoleMode::BYPASS
        {
            // Do nothing
            consoled_sample = sample;
        }
        // Neve like processing from Airwindows but less dynamic
        else if console_type == crate::duro_process::ConsoleMode::NEVE
        {
            // Neve console saturation
            //let mut fdn = Fdn::new(NEVE1272_0[0..5].to_vec(), 6);
            //consoled_sample = fdn.process_sample(sample, 1.0);
            //consoled_sample = apply_taps_to_sample(&NEVE1272_0, sample);
            let mut state = [0.0; NEVE1272_0.len()]; // initialize state buffer with zeroes
            consoled_sample = convolve_sample(sample, &NEVE1272_0, &mut state);

        }
        else if console_type == crate::duro_process::ConsoleMode::SOLID {
            //let mut fdn = Fdn::new(SSL383_0[0..5].to_vec(), 6);
            //consoled_sample = fdn.process_sample(sample, 1.0);

            consoled_sample = apply_taps(&SSL383_0[0..33], sample);
        }
        // Golden Cubic Compressor - Harsher Ardura Sound
        else if console_type == crate::duro_process::ConsoleMode::GOLDENCUBE
        {
            // Precalculated coefficients for each band in form (b0, b1, b2, a1, a2)
            // See function generate_biquads() for how these were calculated

            // Precalculated coefficients for each band in form (b0, b1, b2, a1, a2)
            let mut eq_coefficients: Vec<(f32, f32, f32, f32, f32)> = Vec::new();
            // OG
            eq_coefficients.push((0.51938915, -1.0387783, 0.51938915, -1.6806157, 0.6809415));
            eq_coefficients.push((0.75525904, -1.5105181, 0.75525904, -2.4434495, 1.4446898));
            eq_coefficients.push((0.7393929, -1.4787858, 0.7393929, -2.3911355, 1.3943157));
            eq_coefficients.push((0.75269693, -1.5053939, 0.75269693, -2.4315367, 1.44002));
            eq_coefficients.push((0.67268544, -1.3453709, 0.67268544, -2.166914, 1.1867976));
            eq_coefficients.push((0.63858646, -1.2771729, 0.63858646, -2.0416443, 1.0913736));
            eq_coefficients.push((0.5029168, -1.0058336, 0.5029168, -1.5755627, 0.67938316));
            eq_coefficients.push((0.66598517, -1.3319703, 0.66598517, -1.9688289, 1.3415176));
            eq_coefficients.push((0.4158936, -0.8317872, 0.4158936, -1.0109569, 0.6807631));
            eq_coefficients.push((0.40065646, -0.8013129, 0.40065646, -0.17842461, 1.4146786));
            eq_coefficients.push((0.064592116, -0.12918423, 0.064592116, 1.2687173, 0.68676627));

            consoled_sample = 0.0;
            
            for coeffs in &eq_coefficients {
                let (b0, b1, b2, a1, a2) = coeffs;

                let output = b0 * sample + b1 * self.prev_gain + b2 * self.prev_gain2;
                let feedback = output - a1 * self.prev_gain - a2 * self.prev_gain2;
        
                self.prev_gain2 = self.prev_gain;
                self.prev_gain = feedback;

                consoled_sample += output;
            }
        }

        #[allow(unreachable_patterns)]
        match sat_type {
            // No saturation
            SaturationModeEnum::NONESAT => return consoled_sample,
            // adding even and odd harmonics
            SaturationModeEnum::TAPESAT => return tape_saturation(consoled_sample, self.drive, self.threshold),
            // Symmetrical saturation because I learned about it when researching DC Offset
            SaturationModeEnum::SYMMETRICAL => return symmetrical_saturate(consoled_sample, self.drive, self.threshold),
            // Chebyshev polynomial saturation based off the symmetrical saturation research - pretending to be tape
            SaturationModeEnum::CHEBYSHEV => return chebyshev_tape(consoled_sample, self.drive),
            // Golden Cubic designed by Ardura
            SaturationModeEnum::GOLDENCUBIC => return golden_cubic(consoled_sample, self.threshold),
            SaturationModeEnum::VCAMODEL => return vca_saturation(consoled_sample, self.threshold, self.drive),
            SaturationModeEnum::TRANSFORMER => return transformer_saturation(consoled_sample, self.threshold, 4.0,0.8),
            // Default to no saturation
            _ => return consoled_sample,
        }

    }
}
